import React from "react";
import Card from "../../UI/Card/Card";
import ProductItem from "./ProductItem";

const ProductList = (props) =>{
    
    return(
        <ul>{props.products.map((product) =>
            <li style={{display: 'inline-block', marginRight: '300px'}}>
                <ProductItem key={product.id} productName={product.prod_name} price={product.price} stock={product.stock}/>
            </li>
        )}
        </ul>
    );
}

export default ProductList;
